.timer {
    display: flex;
    background-color:#F30023;
    width: 50vw;
    margin: 0 auto;
    margin-top: 20vh;
    height: 200px;
    border-radius: 30px;
    border: 4px solid #5F007E;
}

.timer-time {
    width: 75%;
    height: 100%;
    display: flex;
    align-content: center;
    align-items: center;
    align-self: center;
    border-right: 4px solid #5F007E;
}

.timer-buttons {
    width: 25%;
    height: 100%;
}

.button {
    height: 33.3333%;
}

button {
    background-color: #00C872;
    width: 100%;
    height: 100%;
    border: none;
}

.top-corner {
    border-top-right-radius: 30px;
    border-bottom: 4px solid #5F007E;
}

.bottom-corner {
    border-bottom-right-radius: 30px;
    border-top: 4px solid #5F007E;
}

button:hover {
    background-color: white;
}

button:hover h3 {
    color: #F30023;
}
